INSERT INTO `tbbsnm08` VALUES ('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',0,NULL,0,'<p>LIBRO MIL CIEN.---------------&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>- - - MEXICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, despu&eacute;s de haberme identificado plenamente como notario, hago constar LA ${var:tramite_operacion} que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;<br />\n&nbsp;&nbsp; &nbsp;<br />\n--------------------- A N T E C E D E N T E S.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n&nbsp;&nbsp; &nbsp;<br />\nI.- Por escritura n&uacute;mero ${var:numero_libro(funcion=texto)}, de fecha ${var:fecha_escritura(funcion=texto)}, ante el licenciado ${frm:antecedente_notaria[notario]}, titular de la notar&iacute;a n&uacute;mero ${frm:antecedente_notaria[numero(funcion=texto)]} del Distrito Federal, ${frm:antecedente_compraventa[gravamen_libre(contenido=se encuentra libre de &nbsp;grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes, presentado en el Registro P&uacute;blico de la Propiedad de esta capital)]}, ${var:compareciente_estado_civil_texto(tipo=VENDEDOR)}, adquirieron por compraventa &ndash;---------------------------------, en precio de ${frm:antecedente_compraventa[inmueble_precio]} ${frm:antecedente_compraventa[inmueble_precio_moneda]}, el inmueble ubicado en ${frm:antecedente_compraventa[inmueble_direccion]}, con la superficie y linderos que en el t&iacute;tulo que se relaciona se describieron como sigue:&nbsp;&nbsp; &nbsp;<br />\n&ldquo;&hellip;con una superficie de&nbsp;&nbsp; &nbsp;<br />\n${frm:antecedente_compraventa[inmueble_superficie]},&nbsp;&nbsp; &nbsp;<br />\ncon los siguientes linderos y dimensiones:&nbsp;&nbsp; &nbsp;<br />\n${frm:antecedente_compraventa[inmueble_lindero_norte]}, ${frm:antecedente_compraventa[inmueble_lindero_sur]},<br />\n${frm:antecedente_compraventa[inmueble_lindero_este]},<br />\n${frm:antecedente_compraventa[inmueble_lindero_oeste]}&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nDe lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.&nbsp;&nbsp; &nbsp;<br />\nII.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra ${frm:antecedente_compraventa[gravamen_libre(contenido=se encuentra libre de &nbsp;grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes, presentado en el Registro P&uacute;blico de la Propiedad de esta capital,)]} ${frm:antecedente_compraventa[gravemen_cancelado_inscrito(contenido=Es de advertir que la hipoteca que reporta dicho certificado no tiene raz&oacute;n de ser en virtud de haber sido cancelada )]} &nbsp;${frm:antecedente_compraventa[gravamen_numero_escritura(funcion=texto)]} ${frm:antecedente_compraventa[gravamen_inscrito_folio_real(contenido=cuyo primer testimonio est&aacute; pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta Capital | cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad de esta Capital en el folio real n&uacute;mero #VALOR)]} ${frm:antecedente_compraventa[gravemen_cancelado_mismoinstrumento(contenido=Es de advertir que la hipoteca que reporta dicho certificado fue cancelada y se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes, presentado en el Registro P&uacute;blico de la Propiedad de esta capital. Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante, en este mismo instrumento)]} ${frm:antecedente_compraventa[gravamen_cancelado_separado(contenido=Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]} ${frm:antecedente_compraventa[gravamen_fecha_escritura(funcion=texto)]} &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nIII.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;<br />\nA.- Predial: &ldquo;${frm:antecedente_compravente[inmueble_predial]}&rdquo; (${frm:antecedente_compravente[inmueble_predial(funcion=texto)]}).&nbsp;&nbsp; &nbsp;<br />\nB.- Agua: &ldquo;${frm:antecedente_compraventa[inmueble_agua]}&rdquo; (${frm:antecedente_compraventa[inmueble_agua(funcion=texto)]}).&nbsp;&nbsp; &nbsp;<br />\nAsimismo, que &ldquo;LA PARTE VENDEDORA&rdquo; entrega en este acto a &ldquo;LA PARTE COMPRADORA&rdquo; la totalidad de las declaraciones y comprobantes de pago de las contribuciones del referido inmueble que obran en su poder, conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nIV.- El valor catastral del inmueble objeto de esta escritura es la cantidad de ${frm:antecedente_compraventa[inmueble_valor_catastral]}, ${frm:antecedente_compraventa[inmueble_valor_catastral_moneda]}.&nbsp;&nbsp; &nbsp;<br />\nV.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:antecedente_compraventa[inmueble_avaluo_valor]}, ${frm:antecedente_compraventa[inmueble_avaluo_moneda]}, seg&uacute;n el aval&uacute;o formulado por &ldquo;${frm:antecedente_compraventa[inmueble_avaluo_valuador]}, el d&iacute;a<br />\n${frm:antecedente_compraventa[inmueble_avaluo_fecha]}, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\n---------------------- C L &Aacute; U S U L A S.&nbsp;&nbsp; &nbsp;<br />\nPRIMERA.- ${var:compareciente_nombre(tipo=VENDEDOR)}, venden a ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere la casa ubicada en ${frm:antecedente_compraventa[inmueble_direccion]}, con la superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen, con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;<br />\nSEGUNDA.- La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;<br />\nI.- El precio importa la suma de ${frm:antecedente_compraventa[inmueble_avaluo_valor]}, ${frm:antecedente_compraventa[inmueble_avaluo_moneda]}.&nbsp;&nbsp; &nbsp;<br />\nII. - La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nA.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nB.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nC.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nCualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nTERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;<br />\nCUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nQUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;<br />\nYO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;<br />\nI.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nII.- Que el inmueble objeto de esta escritura se encuentra inscrito en el Registro de Planes y Programas de Desarrollo Urbano, seg&uacute;n se desprende de la impresi&oacute;n de la consulta realizada que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nIII.- Que advert&iacute; a la parte adquirente que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer relacionadas con el inmueble objeto de esta escritura, anteriores a la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nIV.- Que respecto al Impuesto al Valor Agregado, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a ${frm:antecedente_compraventa[uso_inmueble]}.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nV.- Que respecto al Impuesto Sobre la Renta, el ingreso percibido por &nbsp;&ldquo;LA &nbsp;PARTE &nbsp;VENDEDORA&rdquo; &nbsp;se &nbsp;encuentra &nbsp;exento, &nbsp;toda &nbsp;vez &nbsp;que esta:&nbsp;&nbsp; &nbsp;<br />\na)${frm:antecedente_compraventa[impuesto_excento(contenido=Demuestra ante el suscrito notario haber ocupado el inmueble objeto de esta escritura para su casa habitaci&oacute;n durante los cinco a&ntilde;os anteriores a la fecha de firma del presente instrumento, conforme a los documentos que agrego al ap&eacute;ndice de esta escritura con la letra)]} &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nb)${frm:antecedente_compraventa[primera_enajenacion(contenido= falta texto cuando no es primera enajenacion |Declara que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en este a&ntilde;o calendario )]}.&nbsp;&nbsp; &nbsp;<br />\nAsimismo, declara que la superficie del terreno enajenado no excede &ndash;---- veces al &aacute;rea de desplante de las construcciones del mismo.&nbsp;&nbsp; &nbsp;<br />\nVI.-Que declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo;, que el inmueble objeto de esta escritura, ${frm:antecedente_compraventa[arrendamiento(contenido=no se encuentra sujeto a contrato de arrendamiento alguno | falta texto de cuando se encuentra en arrendamiento)]}.&nbsp;&nbsp; &nbsp;<br />\nVII.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;<br />\n${var:compareciente_nombre(tipo=COMPRADOR)}, ${var:compareciente_nacionalidad(tipo=COMPRADOR)}, originaria de &nbsp;${var:compareciente_originario(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, ${var:compareciente_estado_civil(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, ${var:compareciente_ocupacion(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y con Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;. Se identifica con ${var:compareciente_ri_tipodocumento(tipo=COMPRADOR)} n&uacute;mero ${var:compareciente_ri_valordocumento(tipo=COMPRADOR)}.&nbsp;&nbsp; &nbsp;<br />\n${var:compareciente_nombre(tipo=VENDEDOR)}, ${var:compareciente_nacionalidad(tipo=VENDEDOR)}, originaria de &nbsp;${var:compareciente_originario(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, ${var:compareciente_estado_civil(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, ${var:compareciente_ocupacion(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y con Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.. Se identifica con ${var:compareciente_ri_tipodocumento(tipo=VENDEDOR)} n&uacute;mero ${var:compareciente_ri_valordocumento(tipo=VENDEDOR)}.&nbsp;&nbsp; &nbsp;<br />\n&nbsp;&nbsp; &nbsp;<br />\nVIII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo;, el importe de la compraventa con anterioridad a la celebraci&oacute;n de este acto, seg&uacute;n declaran bajo protesta de decir verdad.&nbsp;&nbsp; &nbsp;<br />\nIX.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;<br />\nX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;<br />\nXI.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a ${var:escritura_fecha_firma}</p>\n','73D19B3BA5765D13FCE420B3DF97476B','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',1,NULL,0,'<p>LIBRO MIL CIEN.---------------&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>- - - MEXICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, despu&eacute;s de haberme identificado plenamente como notario, hago constar LA ${var:tramite_operacion} que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;<br />\n&nbsp;&nbsp; &nbsp;<br />\n--------------------- A N T E C E D E N T E S.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n&nbsp;&nbsp; &nbsp;<br />\nI.- Por escritura n&uacute;mero mil cien, de fecha ${var:fecha_escritura(funcion=texto)}, ante el licenciado ${frm:antecedente_notaria[notario]}, titular de la notar&iacute;a n&uacute;mero ${frm:antecedente_notaria[numero(funcion=texto)]} del Distrito Federal, ${frm:antecedente_compraventa[gravamen_libre(contenido=se encuentra libre de &nbsp;grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes, presentado en el Registro P&uacute;blico de la Propiedad de esta capital)]}, ${var:compareciente_estado_civil_texto(tipo=VENDEDOR)}, adquirieron por compraventa &ndash;---------------------------------, en precio de ${frm:antecedente_compraventa[inmueble_precio]} ${frm:antecedente_compraventa[inmueble_precio_moneda]}, el inmueble ubicado en ${frm:antecedente_compraventa[inmueble_direccion]}, con la superficie y linderos que en el t&iacute;tulo que se relaciona se describieron como sigue:&nbsp;&nbsp; &nbsp;<br />\n&ldquo;&hellip;con una superficie de&nbsp;&nbsp; &nbsp;<br />\n${frm:antecedente_compraventa[inmueble_superficie]},&nbsp;&nbsp; &nbsp;<br />\ncon los siguientes linderos y dimensiones:&nbsp;&nbsp; &nbsp;<br />\n${frm:antecedente_compraventa[inmueble_lindero_norte]}, ${frm:antecedente_compraventa[inmueble_lindero_sur]},<br />\n${frm:antecedente_compraventa[inmueble_lindero_este]},<br />\n${frm:antecedente_compraventa[inmueble_lindero_oeste]}&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nDe lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.&nbsp;&nbsp; &nbsp;<br />\nII.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra ${frm:antecedente_compraventa[gravamen_libre(contenido=se encuentra libre de &nbsp;grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes, presentado en el Registro P&uacute;blico de la Propiedad de esta capital,)]} ${frm:antecedente_compraventa[gravemen_cancelado_inscrito(contenido=Es de advertir que la hipoteca que reporta dicho certificado no tiene raz&oacute;n de ser en virtud de haber sido cancelada )]} &nbsp;${frm:antecedente_compraventa[gravamen_numero_escritura(funcion=texto)]} ${frm:antecedente_compraventa[gravamen_inscrito_folio_real(contenido=cuyo primer testimonio est&aacute; pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta Capital | cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad de esta Capital en el folio real n&uacute;mero #VALOR)]} ${frm:antecedente_compraventa[gravemen_cancelado_mismoinstrumento(contenido=Es de advertir que la hipoteca que reporta dicho certificado fue cancelada y se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes, presentado en el Registro P&uacute;blico de la Propiedad de esta capital. Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante, en este mismo instrumento)]} ${frm:antecedente_compraventa[gravamen_cancelado_separado(contenido=Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]} ${frm:antecedente_compraventa[gravamen_fecha_escritura(funcion=texto)]} &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nIII.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;<br />\nA.- Predial: &ldquo;${frm:antecedente_compravente[inmueble_predial]}&rdquo; (${frm:antecedente_compravente[inmueble_predial(funcion=texto)]}).&nbsp;&nbsp; &nbsp;<br />\nB.- Agua: &ldquo;${frm:antecedente_compraventa[inmueble_agua]}&rdquo; (${frm:antecedente_compraventa[inmueble_agua(funcion=texto)]}).&nbsp;&nbsp; &nbsp;<br />\nAsimismo, que &ldquo;LA PARTE VENDEDORA&rdquo; entrega en este acto a &ldquo;LA PARTE COMPRADORA&rdquo; la totalidad de las declaraciones y comprobantes de pago de las contribuciones del referido inmueble que obran en su poder, conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nIV.- El valor catastral del inmueble objeto de esta escritura es la cantidad de ${frm:antecedente_compraventa[inmueble_valor_catastral]}, ${frm:antecedente_compraventa[inmueble_valor_catastral_moneda]}.&nbsp;&nbsp; &nbsp;<br />\nV.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:antecedente_compraventa[inmueble_avaluo_valor]}, ${frm:antecedente_compraventa[inmueble_avaluo_moneda]}, seg&uacute;n el aval&uacute;o formulado por &ldquo;${frm:antecedente_compraventa[inmueble_avaluo_valuador]}, el d&iacute;a<br />\n${frm:antecedente_compraventa[inmueble_avaluo_fecha]}, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\n---------------------- C L &Aacute; U S U L A S.&nbsp;&nbsp; &nbsp;<br />\nPRIMERA.- ${var:compareciente_nombre(tipo=VENDEDOR)}, venden a ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere la casa ubicada en ${frm:antecedente_compraventa[inmueble_direccion]}, con la superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen, con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;<br />\nSEGUNDA.- La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;<br />\nI.- El precio importa la suma de ${frm:antecedente_compraventa[inmueble_avaluo_valor]}, ${frm:antecedente_compraventa[inmueble_avaluo_moneda]}.&nbsp;&nbsp; &nbsp;<br />\nII. - La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nA.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nB.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nC.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nCualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nTERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;<br />\nCUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nQUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;<br />\nYO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;<br />\nI.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nII.- Que el inmueble objeto de esta escritura se encuentra inscrito en el Registro de Planes y Programas de Desarrollo Urbano, seg&uacute;n se desprende de la impresi&oacute;n de la consulta realizada que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nIII.- Que advert&iacute; a la parte adquirente que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer relacionadas con el inmueble objeto de esta escritura, anteriores a la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nIV.- Que respecto al Impuesto al Valor Agregado, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a ${frm:antecedente_compraventa[uso_inmueble]}.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\nV.- Que respecto al Impuesto Sobre la Renta, el ingreso percibido por &nbsp;&ldquo;LA &nbsp;PARTE &nbsp;VENDEDORA&rdquo; &nbsp;se &nbsp;encuentra &nbsp;exento, &nbsp;toda &nbsp;vez &nbsp;que esta:&nbsp;&nbsp; &nbsp;<br />\na)${frm:antecedente_compraventa[impuesto_excento(contenido=Demuestra ante el suscrito notario haber ocupado el inmueble objeto de esta escritura para su casa habitaci&oacute;n durante los cinco a&ntilde;os anteriores a la fecha de firma del presente instrumento, conforme a los documentos que agrego al ap&eacute;ndice de esta escritura con la letra)]} &ldquo;#LETRA&rdquo;.&nbsp;&nbsp; &nbsp;<br />\nb)${frm:antecedente_compraventa[primera_enajenacion(contenido= falta texto cuando no es primera enajenacion |Declara que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en este a&ntilde;o calendario )]}.&nbsp;&nbsp; &nbsp;<br />\nAsimismo, declara que la superficie del terreno enajenado no excede &ndash;---- veces al &aacute;rea de desplante de las construcciones del mismo.&nbsp;&nbsp; &nbsp;<br />\nVI.-Que declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo;, que el inmueble objeto de esta escritura, ${frm:antecedente_compraventa[arrendamiento(contenido=no se encuentra sujeto a contrato de arrendamiento alguno | falta texto de cuando se encuentra en arrendamiento)]}.&nbsp;&nbsp; &nbsp;<br />\nVII.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;<br />\n${var:compareciente_nombre(tipo=COMPRADOR)}, ${var:compareciente_nacionalidad(tipo=COMPRADOR)}, originaria de &nbsp;${var:compareciente_originario(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, ${var:compareciente_estado_civil(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, ${var:compareciente_ocupacion(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y con Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;. Se identifica con ${var:compareciente_ri_tipodocumento(tipo=COMPRADOR)} n&uacute;mero ${var:compareciente_ri_valordocumento(tipo=COMPRADOR)}.&nbsp;&nbsp; &nbsp;<br />\n${var:compareciente_nombre(tipo=VENDEDOR)}, ${var:compareciente_nacionalidad(tipo=VENDEDOR)}, originaria de &nbsp;${var:compareciente_originario(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, ${var:compareciente_estado_civil(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, ${var:compareciente_ocupacion(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y con Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.. Se identifica con ${var:compareciente_ri_tipodocumento(tipo=VENDEDOR)} n&uacute;mero ${var:compareciente_ri_valordocumento(tipo=VENDEDOR)}.&nbsp;&nbsp; &nbsp;<br />\n&nbsp;&nbsp; &nbsp;<br />\nVIII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo;, el importe de la compraventa con anterioridad a la celebraci&oacute;n de este acto, seg&uacute;n declaran bajo protesta de decir verdad.&nbsp;&nbsp; &nbsp;<br />\nIX.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;<br />\nX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;<br />\nXI.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a ${var:escritura_fecha_firma}</p>\n','73D19B3BA5765D13FCE420B3DF97476B','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',2,NULL,0,'<p><span style=\"font-size:13px; line-height:1.6\">COMPRAVENTA CASAHABITACION DF</span></p>\n\n<p>&nbsp;</p>\n\n<p>LIBRO_${var:numero_libro(funcion=texto)}_.-------------------${var:notaria_notario_inciales}/${var:abogado_inciales}/${var:protocolista_inciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>_________________________________________.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - MEXICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, actuando como asociado en el protocolo de la notar&iacute;a n&uacute;mero ${var:notaria_asociada_numero(funcion=texto)}, de la que es titular el licenciado ${var:notaria_asociada_notario}, despu&eacute;s de haberme identificado plenamente como notario, hago constar LA ${var:tramite_operacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero_${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}_, de fecha_${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}_, ante el licenciado_${frm:ante_propiedad[ant_prop_nom_not]}_, titular de la notar&iacute;a n&uacute;mero _${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]}_ del _${frm:ante_propiedad[ant_prop_lugar]}_, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad de _${frm:ante_propiedad[ant_prop_datos_ins]}_, en el folio real n&uacute;mero ______________________________________________________, el se&ntilde;or_${var:compareciente_nombre(tipo=VENDEDOR)}_, estando __________________________________________________, adquiri&oacute; por_________________________________________________, en precio de _${frm:ante_propiedad[ant_prop_cost_adq]}_pesos, moneda nacional, (descripci&oacute;n inmueble)_, con la superficie y linderos que en el t&iacute;tulo que se relaciona se describieron como sigue:&nbsp;&nbsp; &nbsp;</p>\n\n<p><em>&ldquo;&hellip;_</em>${frm:desc_inmueble[inm_superficie]} ${frm:desc_inmueble[inm_linderos]}<em>_&hellip;&rdquo;.</em></p>\n\n<p>II.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura ${frm:gravamen[grav_libre]}_, que &nbsp;agrego al &nbsp;ap&eacute;ndice &nbsp;de este &nbsp;instrumento &nbsp;con &nbsp;la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_predial]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_predial(funcion=texto)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(tipo=texto)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de _${frm:ant_sit_catastral[ant_valor_catastral]}_ &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de _${frm:ant_avaluo[ant_avaluo_valor]}_PESOS, MONEDA NACIONAL, seg&uacute;n el aval&uacute;o formulado por _${frm:ant_avaluo[ant_avaluo_valuador]}_, el d&iacute;a _${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}_, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- Los se&ntilde;ores _${var:compareciente_nombre(tipo=VENDEDOR)}_, venden al &nbsp;se&ntilde;or_${var:compareciente_nombre(tipo=COMPRADOR)}_, quien adquiere el _____________________________________________________________________________________________________________________________________________________________________________________________________, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de _${frm:operacion[op_precio]}_, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_${frm:operacion[op_excencion]}_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, _${var:compareciente_nombre(tipo=COMPRADOR , funcion=alias)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=COMPRADOR , funcion=texto)}_, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_compareciente_curp(tipo=COMPRADOR)_&rdquo;, y Clave 