una especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_${frm:operacion[op_excencion]}_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, _${var:compareciente_nombre(tipo=COMPRADOR , funcion=alias)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=COMPRADOR , funcion=texto)}_, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_compareciente_curp(tipo=COMPRADOR)_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=COMPRADOR)}_&rdquo;</p>\n\n<p>_${var:compareciente_nombre(tipo=VENDEDOR)}_, _${var:compareciente_nombre(tipo= VENDEDOR , funcion=alias)}_, originario de _${var:compareciente_originario(tipo=VENDEDOR)}_, Estado de _${var:compareciente_estado(tipo=VENDEDOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=VENDEDOR, funcion=texto)}_, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_compareciente_curp(tipo=VENDEDOR)_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=VENDEDOR)}_&rdquo;.VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p><br />\n&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a.</p>\n','DA0F9DB9D4AA4C92472DE02B38C4D01B','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',6,NULL,0,'<p>&nbsp;</p>\n\n<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>LIBRO_${var:numero_libro(funcion=texto)}_.-------------------${var:notaria_notario_inciales}/${var:abogado_inciales}/${var:protocolista_inciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>_________________________________________.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - MEXICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, actuando como asociado en el protocolo de la notar&iacute;a n&uacute;mero ${var:notaria_asociada_numero(funcion=texto)}, de la que es titular el licenciado ${var:notaria_asociada_notario}, despu&eacute;s de haberme identificado plenamente como notario, hago constar LA ${var:tramite_operacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero_${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}_, de fecha_${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}_, ante el licenciado_${frm:ante_propiedad[ant_prop_nom_not]}_, titular de la notar&iacute;a n&uacute;mero _${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]}_ del _${frm:ante_propiedad[ant_prop_lugar]}_, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad de _${frm:ante_propiedad[ant_prop_datos_ins]}_, en el folio real n&uacute;mero _${frm:gravamen[grav_insc_folio_real]}_, el se&ntilde;or_${var:compareciente_nombre(tipo=VENDEDOR)}_, estando _${var:compareciente_compro_casado(tipo=VENDEDOR)}_, adquiri&oacute; por_${frm:ante_propiedad[ant_prop_titulo]}_, en precio de _${frm:ante_propiedad[ant_prop_cost_adq]}_pesos, moneda nacional, (descripci&oacute;n inmueble)_, con la superficie ${frm:desc_inmueble[inm_superficie]} y linderos que en el t&iacute;tulo que se relaciona se describieron como sigue</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p><em>&ldquo;&hellip;_</em> ${frm:desc_inmueble[inm_linderos]}<em>_&hellip;&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura ${frm:gravamen[grav_libre]}_, que &nbsp;agrego al &nbsp;ap&eacute;ndice &nbsp;de este &nbsp;instrumento &nbsp;con &nbsp;la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_predial]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_predial(funcion=texto)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(tipo=texto)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de _${frm:ant_sit_catastral[ant_valor_catastral]}_ &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de _${frm:ant_avaluo[ant_avaluo_valor]}_PESOS, MONEDA NACIONAL, seg&uacute;n el aval&uacute;o formulado por _${frm:ant_avaluo[ant_avaluo_valuador]}_, el d&iacute;a _${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}_, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- Los se&ntilde;ores _${var:compareciente_amboscompraron}_, venden al &nbsp;se&ntilde;or_${var:compareciente_nombre(tipo=COMPRADOR)}_, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, calle ${frm:desc_inmueble[inm_calle]}, en la colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}_, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de _${frm:operacion[op_precio]}_, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_${frm:operacion[op_excencion]}_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, _${var:compareciente_nombre(tipo=COMPRADOR)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_compareciente_curp(tipo=COMPRADOR)_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=COMPRADOR)}_&rdquo;</p>\n\n<p>_${var:compareciente_nombre(tipo=VENDEDOR)}_, originario de _${var:compareciente_originario(tipo=VENDEDOR)}_, Estado de _${var:compareciente_estado(tipo=VENDEDOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_compareciente_curp(tipo=VENDEDOR)_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=VENDEDOR)}_&rdquo;.VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p><br />\n&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n','764D23655EFDF995E92086DCFA44DFA7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',7,NULL,0,'<p>&nbsp;</p>\n\n<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>LIBRO_${var:numero_libro(funcion=texto)}_.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>_________________________________________.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - MEXICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, actuando como asociado en el protocolo de la notar&iacute;a n&uacute;mero ${var:notaria_asociada_numero(funcion=texto)}, de la que es titular el licenciado ${var:notaria_asociada_notario}, despu&eacute;s de haberme identificado plenamente como notario, hago constar LA ${var:tramite_operacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero_${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}_, de fecha_${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}_, ante el licenciado_${frm:ante_propiedad[ant_prop_nom_not]}_, titular de la notar&iacute;a n&uacute;mero _${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]}_ del _${frm:ante_propiedad[ant_prop_lugar]}_, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad de _${frm:ante_propiedad[ant_prop_datos_ins]}_, en el folio real n&uacute;mero _${frm:gravamen[grav_insc_folio_real]}_, el se&ntilde;or_${var:compareciente_nombre(tipo=VENDEDOR)}_, estando _${var:compareciente_compro_casado(tipo=VENDEDOR)}_, adquiri&oacute; por_${frm:ante_propiedad[ant_prop_titulo]}_, en precio de _${frm:ante_propiedad[ant_prop_cost_adq]}_pesos, moneda nacional, (descripci&oacute;n inmueble)_, con la superficie ${frm:desc_inmueble[inm_superficie]} y linderos que en el t&iacute;tulo que se relaciona se describieron como sigue</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p><em>&ldquo;&hellip;_</em> ${frm:desc_inmueble[inm_linderos]}<em>_&hellip;&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura ${frm:gravamen[grav_libre]}_, que &nbsp;agrego al &nbsp;ap&eacute;ndice &nbsp;de este &nbsp;instrumento &nbsp;con &nbsp;la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_predial]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_predial(funcion=texto)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(tipo=texto)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo,