gravamen[grav_libre(contenido=libre de gravamen|NO LIBRE DE GRAVAMEN)]}_, que &nbsp;agrego al &nbsp;ap&eacute;ndice &nbsp;de este &nbsp;instrumento &nbsp;con &nbsp;la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_predial]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de _${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]}_ &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de _${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]}_PESOS, MONEDA NACIONAL, seg&uacute;n el aval&uacute;o formulado por _${frm:ant_avaluo[ant_avaluo_valuador]}_, el d&iacute;a _${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}_, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- _${{var:compareciente_ambos_compraron}_ al &nbsp;se&ntilde;or_${var:compareciente_nombre(tipo=COMPRADOR)}_, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}_, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de _${frm:operacion[op_precio(funcion=texto)]}_, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=si hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente