el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=si hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=COMPRADOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=COMPRADOR)}_&rdquo;</p>\n\n<p>_${var:compareciente_nombre(tipo=VENDEDOR)}_, originario de _${var:compareciente_originario(tipo=VENDEDOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=VENDEDOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=VENDEDOR)}_&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&ea