er testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad de _${frm:ante_propiedad[ant_prop_datos_ins]}_, en el folio real n&uacute;mero _${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}_, _${var::compareciente_compro_estadocivil(tipo=VENDEDOR)}_, por_${frm:ante_propiedad[ant_prop_titulo]}_, en precio de _${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]}_pesos, moneda nacional,el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p>&nbsp;</p>\n\n<p><em>&ldquo;&hellip;_</em> ${frm:desc_inmueble[inm_linderos]}<em>_&hellip;&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura ${frm:gravamen[grav_libre(contenido=libre de gravamen|NO LIBRE DE GRAVAMEN)]}_, que &nbsp;agrego al &nbsp;ap&eacute;ndice &nbsp;de este &nbsp;instrumento &nbsp;con &nbsp;la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_predial]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones l