m:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}_).<br />\nB.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).<br />\nAsimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras &ldquo;#LETRA&rdquo; y &ldquo;#LETRA&rdquo;.<br />\nIV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de _${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]}_ &nbsp;moneda nacional.<br />\nV.- El valor comercial del inmueble objeto de esta escritura es la cantidad de _${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]}_DE &nbsp;PESOS, MONEDA NACIONAL, seg&uacute;n el aval&uacute;o formulado por _${frm:ant_avaluo[ant_avaluo_valuador]}_, el d&iacute;a _${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}_, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nVI.- Con la letra &ldquo;#LETRA&rdquo; agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.<br />\n---------------------- C L &Aacute; U S U L A S.<br />\nPRIMERA.- _${var:compareciente_ambos_compraron}_ al &nbsp;se&ntilde;or_${var:compareciente_nombre(tipo=COMPRADOR)}_, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}_, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de con