onia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}_, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de _${frm:operacion[op_precio(funcion=texto)]}_, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=si hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=COMPRADOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=COMPRADOR)}_&rdquo;</p>\n\n<p>_${var:compareciente_nombre(tipo=VENDEDOR)}_, originario de _${var:compareciente_originario(tipo=VENDEDOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=VENDEDOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=VENDEDOR)}_&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',45,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>LIBRO_${var:numero_libro(funcion=texto)}_.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - MEXICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero _${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}_, de fecha_${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}_, ante el licenciado _${frm:ante_propiedad[ant_prop_nom_not]}_, titular de la notar&iacute;a n&uacute;mero _${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]}_ del _${frm:ante_propiedad[ant_prop_lugar]}_, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del _${frm:ante_propiedad[ant_prop_datos_ins]}_, en el folio real n&uacute;mero _${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}_, _${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}_, _${frm:ante_propiedad[ant_prop_titulo]}_${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}__, en precio de _${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]}_ de pesos, moneda nacional,el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p>&nbsp;</p>\n\n<p><em>&ldquo;&hellip;_</em> ${frm:desc_inmueble[inm_linderos]}<em>_&hellip;&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a _ &amp;referencia1;_ , que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a _ &amp;referencia1;_ , que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero _&amp;referencia2;_-, ante el notario _&amp;referencia4;_ titular de la notar&iacute;a n&uacute;mero _&amp;referencia5;_, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a _ &amp;referencia1;_ que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}. &nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_predial]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de _${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]}_ &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de _${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]}_DE &nbsp;PESOS, MONEDA NACIONAL, seg&uacute;n el aval&uacute;o formulado por _${frm:ant_avaluo[ant_avaluo_valuador]}_, el d&iacute;a _${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}_, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- _${var:compareciente_ambos_compraron}_ al &nbsp;se&ntilde;or_${var:compareciente_nombre(tipo=COMPRADOR)}_, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}_, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de _${frm:operacion[op_precio(funcion=texto)]}_, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=si hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=COMPRADOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=COMPRADOR)}_&rdquo;</p>\n\n<p>_${var:compareciente_nombre(tipo=VENDEDOR)}_, originario de _${var:compareciente_originario(tipo=VENDEDOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=VENDEDOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=VENDEDOR)}_&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',46,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. &lt;br /&gt;Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',47,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',48,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.&nbsp;Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',49,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',50,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\n<span style=\"line-height:1.6\">Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</span><br />\n<span style=\"line-height:1.6\">Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]} &nbsp; &nbsp;</span></p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',51,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>LIBRO_${var:numero_libro(funcion=texto)}_.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}. &nbsp; &nbsp;</p>\n\n<p>_________________________________________. &nbsp; &nbsp;</p>\n\n<p>- - - MEXICO, DISTRITO FEDERAL, a _${var:fecha_hoy(funcion=texto)}_. &nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas: &nbsp; &nbsp;</p>\n\n<p>--------------------- A N T E C E D E N T E S. &nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero_${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}_, de fecha_${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}_, ante el licenciado_${frm:ante_propiedad[ant_prop_nom_not]}_, titular de la notar&iacute;a n&uacute;mero _${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]}_ del _${frm:ante_propiedad[ant_prop_lugar]}_, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del _${frm:ante_propiedad[ant_prop_datos_ins]}_, en el folio real n&uacute;mero _${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}_, _${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}_, _${frm:ante_propiedad[ant_prop_titulo]}_${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}__, en precio de _${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]}_ de pesos, moneda nacional,el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p>&nbsp;</p>\n\n<p>&ldquo;&hellip;_ ${frm:desc_inmueble[inm_linderos]}_&hellip;&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>II.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a _${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}_, que &nbsp;agrego al &nbsp;ap&eacute;ndice de esta escritura &nbsp;con &nbsp;la letra &ldquo;#LETRA&rdquo;. ${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib:: - |grav_mis::Es de advertir que la hipoteca que aparece en el certificado de grav&aacute;menes ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero _&amp;referencia2;_-, ante el notario _&amp;referencia4;_ titular de la notar&iacute;a n&uacute;mero _&amp;referencia5;_, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Es de advertir que la hipoteca que reporta dicho certificado, ser&aacute; cancelada en instrumento por separado)]}. &nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta: &nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_predial]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}_). &nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_${frm:ant_sit_catastral[ant_num_cta_agua]}_&rdquo;(_${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_). &nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras &ldquo;#LETRA&rdquo; y &ldquo;#LETRA&rdquo;. &nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de _${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]}_ &nbsp;moneda nacional. &nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de _${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]}_DE &nbsp;PESOS, MONEDA NACIONAL, seg&uacute;n el aval&uacute;o formulado por _${frm:ant_avaluo[ant_avaluo_valuador]}_, el d&iacute;a _${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}_, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. &nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra &ldquo;#LETRA&rdquo; agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo. &nbsp; &nbsp;</p>\n\n<p>---------------------- C L &Aacute; U S U L A S. &nbsp; &nbsp;</p>\n\n<p>PRIMERA.- _${var:compareciente_ambos_compraron}_ al &nbsp;se&ntilde;or_${var:compareciente_nombre(tipo=COMPRADOR)}_, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}_, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble. &nbsp; &nbsp;. &nbsp; &nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente: &nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de _${frm:operacion[op_precio(funcion=texto)]}_, moneda nacional. &nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;: &nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio. &nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie. &nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;. &nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes. &nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;. &nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal. &nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO: &nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento. &nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional. &nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=si hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}. &nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser: &nbsp; &nbsp;</p>\n\n<p>_${var:compareciente_nombre(tipo=COMPRADOR)}_, originario de _${var:compareciente_originario(tipo=COMPRADOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=COMPRADOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=COMPRADOR)}_&rdquo;</p>\n\n<p>_${var:compareciente_nombre(tipo=VENDEDOR)}_, originario de _${var:compareciente_originario(tipo=VENDEDOR)}_, Estado de _${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}_, lugar donde naci&oacute; el d&iacute;a _${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}_, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_${var:compareciente_rfc(tipo=VENDEDOR)}_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_${var:compareciente_curp(tipo=VENDEDOR)}_&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario. &nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura. &nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>}</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',52,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',53,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte_${var:compareciente_nombre(tipo=COMPRADOR)}_, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_${var:compareciente_nombre(tipo=VENDEDOR)}_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','F06C0DD7238D0CA1504958A27BA65317','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',54,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la ${var:tramite_suboperacion} que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&n