;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B2958228BC728631E21D657696D3CBF7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',55,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','26A7CD2FCECA38ABC90B127A0941B35D','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',56,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara: ---------------------------------</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.---------------------------------------</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez: ------------------------------------------------------ a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os. --------------------------------------</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. ------------ Asimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez: ------------------------------------------------------ a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os. --------------------------------------</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.--------------------)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',57,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara: ---------------------------------</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.---------------------------------------</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez: ------------------------------------------------------ a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os. --------------------------------------</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. ------------ Asimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez: ------------------------------------------------------ a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os. --------------------------------------</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.--------------------)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',58,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez: ------------------------------------------------------ a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os. --------------------------------------</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. ------------ Asimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez: ------------------------------------------------------ a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n. --------------------------------------------------------------</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os. --------------------------------------</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.--------------------)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',59,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',60,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',61,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &quot;LA PARTE VENDEDORA&quot; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',62,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &quot;LA PARTE VENDEDORA&quot; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia1;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',63,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &quot;LA PARTE VENDEDORA&quot; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p><span style=\"line-height:1.6\">**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</span></p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',64,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &quot;LA PARTE VENDEDORA&quot; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia1;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',65,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &quot;LA PARTE VENDEDORA&quot; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia1;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:operacion[op_isr_pago]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',66,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido=De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8;, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3557116DDD45D85F7EEE8A0527130836','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',67,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','4DB7F8A6EE3414C4B95822254926BFC7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',68,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','4DB7F8A6EE3414C4B95822254926BFC7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',69,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por ***NOMBRE DEL ENAJENANTE*** se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','4DB7F8A6EE3414C4B95822254926BFC7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',70,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','4DB7F8A6EE3414C4B95822254926BFC7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',71,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de $referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de $referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','4DB7F8A6EE3414C4B95822254926BFC7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',72,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra</p>\n\n<p>exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','4DB7F8A6EE3414C4B95822254926BFC7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',73,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, con el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;</p>\n\n<p>********************** ISR ************************</p>\n\n<p>${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>********************** ISR ************************</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_excencion(contenido=esta excento|no esta excento)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','4DB7F8A6EE3414C4B95822254926BFC7','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',74,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento.|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','15AA97385B2037DF93F3214F05ED9374','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',75,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento.|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','15AA97385B2037DF93F3214F05ED9374','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',76,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=texto)]} pesos, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=texto)]} &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=texto)]} moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=texto)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=texto)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=texto)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=texto)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','15AA97385B2037DF93F3214F05ED9374','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',77,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a.- Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a.- Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b.- Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c.- Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B477B2767B29DEB1EC9293B4C72F9144','2014-06-25 15:30:30');
INSERT INTO `tbbsnm08` VALUES ('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',78,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B477B2767B29DEB1EC9293B4C72F9144','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',79,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con la superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos]}<em>&rdquo;.</em></p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','7931760BE4DF998D3AF08788B2438FF6','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',80,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario (function=mayusculas)}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext](function=texto)}, de la calle ${frm:desc_inmueble[inm_calle])}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos](funcion=texto)}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',81,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario (function=mayusculas)}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext](funcion=texto)}, de la calle ${frm:desc_inmueble[inm_calle])}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>${frm:desc_inmueble[inm_linderos](funcion=texto)}<em>&rdquo;.</em></p>\n\n<p>${frm:ante_propiedad[antecedente_ala_vista(contenido= |De lo anterior me impuse, a solicitud de los interesados, en t&eacute;rminos de lo dispuesto por la fracci&oacute;n s&eacute;ptima del art&iacute;culo ciento dos de la Ley del Notariado para el Distrito Federal.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2; con fecha &amp;referencia3;, ante el notario &amp;referencia4; titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}_).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]} delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]} del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',82,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext](funcion=texto)}, de la calle ${frm:desc_inmueble[inm_calle])}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, con c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este &nbsp;${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p>&ldquo;<em>${frm:desc_inmueble[inm_linderos](funcion=texto)}</em>&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional. &nbsp;&nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.&nbsp;</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p><span style=\"line-height:1.6\">V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]} &nbsp; &nbsp;</span></p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p><span style=\"line-height:1.6\">VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</span></p>\n\n<p><span style=\"line-height:1.6\">VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario. &nbsp; &nbsp;</span></p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',83,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}, ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle])}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, con c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este &nbsp;${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p>&ldquo;<em>${frm:desc_inmueble[inm_linderos](funcion=texto)}</em>&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',84,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}, ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, con c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este &nbsp;${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p>&ldquo;<em>${frm:desc_inmueble[inm_linderos](funcion=texto)}</em>&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',85,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos](funcion=texto)}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',86,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',87,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',88,NULL,0,'<p><br />\n<br />\n<br />\n<br />\n<br />\n&nbsp;</p>\n\n<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.<br />\n${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.<br />\nV.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.<br />\nVI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:<br />\nA.- Sin limitaci&oacute;n alguna en su dominio<br />\nB.- Sin gravamen de ninguna especie.<br />\nC.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.<br />\nTERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.<br />\nCUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.<br />\nQUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.<br />\nYO EL NOTARIO CERTIFICO:<br />\nI.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.<br />\nIII.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.<br />\nIV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}<br />\nV.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}<br />\nVI.- Que los comparecientes declaran por sus generales ser:<br />\n${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.<br />\nVII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.<br />\nVIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.<br />\nIX.- Que tuve a la vista los documentos citados en esta escritura.<br />\nX.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','B13C11F113539DC03CCE25151D4B4DB1','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',89,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}<s>, </s>${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]<s>(funcion=texto)</s>}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3A08CE5AE3F6F2298CFD04DD49FCA6F9','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',90,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.<br />\nV.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.<br />\nVI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:<br />\nA.- Sin limitaci&oacute;n alguna en su dominio<br />\nB.- Sin gravamen de ninguna especie.<br />\nC.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.<br />\nTERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.<br />\nCUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.<br />\nQUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.<br />\nYO EL NOTARIO CERTIFICO:<br />\nI.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.<br />\nIII.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.<br />\nIV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}<br />\nV.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}<br />\nVI.- Que los comparecientes declaran por sus generales ser:<br />\n${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.<br />\nVII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.<br />\nVIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.<br />\nIX.- Que tuve a la vista los documentos citados en esta escritura.<br />\nX.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3A08CE5AE3F6F2298CFD04DD49FCA6F9','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',91,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','3A08CE5AE3F6F2298CFD04DD49FCA6F9','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',92,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>&nbsp;</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','0930A173B8F3976CF774538E4B9F1507','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',93,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','0930A173B8F3976CF774538E4B9F1507','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',94,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','0930A173B8F3976CF774538E4B9F1507','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',95,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','0930A173B8F3976CF774538E4B9F1507','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',96,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR)} ${var:compareciente_nombre(tipo=COMPRADOR)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR)} ${var:compareciente_nombre(tipo=VENDEDOR)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto)]} del ${frm:ante_propiedad[ant_prop_lugar]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]} ${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}). &nbsp; &nbsp;<br />\n<span style=\"line-height:1.6\">B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</span></p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle]}, colonia ${frm:desc_inmueble[inm_colonia]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR)}, originario de ${var:compareciente_originario(tipo=COMPRADOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>***referencia7;=${var:notaria_notario!gravamen.grav_canc_num_exp}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','0930A173B8F3976CF774538E4B9F1507','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',97,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto,mayusculas)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto,oracion)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario,mayusculas}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto,minusculas)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR,minusculas)} ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR,minusculas)} ${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto,capital)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not(funcion=mayusculas)]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto,minusculas)]} del ${frm:ante_propiedad[ant_prop_lugar (function=oracion)]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto, minusculas)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie(funcion=minusculas)]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos(funcion=capital)]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador (funcion=oracion)]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado (funcion=oracion)]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.</p>\n\n<p>B.- Sin gravamen de ninguna especie.</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.</p>\n\n<p>IV.- ${frm:operacion[op_isr(contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=COMPRADOR,oracion)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR,oracion)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR,minusculas)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not (funcion=mayusculas)]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad (funcion=oracion)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','966277D5F37663DE8F82FDED06DC4A63','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',98,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto,mayusculas)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto,oracion)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario,mayusculas}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto,minusculas)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR,minusculas)} ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR,minusculas)} ${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto,capital)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not(funcion=mayusculas)]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto,minusculas)]} del ${frm:ante_propiedad[ant_prop_lugar (funcion=oracion)]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto, minusculas)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie(funcion=minusculas)]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos(funcion=capital)]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador (funcion=oracion)]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado (funcion=oracion)]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.</p>\n\n<p>B.- Sin gravamen de ninguna especie.</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.</p>\n\n<p>IV.- ${frm:operacion[op_isr(a)contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=COMPRADOR,oracion)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR,oracion)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR,minusculas)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not (funcion=mayusculas)]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad (funcion=oracion)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','966277D5F37663DE8F82FDED06DC4A63','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',99,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto,mayusculas)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto,oracion)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto,minusculas)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR,minusculas)} ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR,minusculas)} ${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto,capital)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not(funcion=mayusculas)]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto,minusculas)]} del ${frm:ante_propiedad[ant_prop_lugar (funcion=oracion)]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto, minusculas)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie(funcion=minusculas)]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos(funcion=capital)]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador (funcion=oracion)]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado (funcion=oracion)]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.</p>\n\n<p>B.- Sin gravamen de ninguna especie.</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.</p>\n\n<p>IV.- ${frm:operacion[op_isr(a)contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=COMPRADOR,oracion)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR,oracion)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR,minusculas)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not (funcion=mayusculas)]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad (funcion=oracion)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','966277D5F37663DE8F82FDED06DC4A63','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',100,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto,mayusculas)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto,oracion)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto,minusculas)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR,minusculas)} ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR,minusculas)} ${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not(funcion=mayusculas)]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto,minusculas)]} del ${frm:ante_propiedad[ant_prop_lugar(funcion=oracion)]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle(funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia(funcion=oracion)]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion(funcion=oracion)]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto,minusculas)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie(funcion=minusculas)]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos(funcion=capital)]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador (funcion=oracion)]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado (funcion=oracion)]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.</p>\n\n<p>B.- Sin gravamen de ninguna especie.</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.</p>\n\n<p>IV.- ${frm:operacion[op_isr(a)contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=COMPRADOR,oracion)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR,oracion)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR,minusculas)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not (funcion=mayusculas)]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad (funcion=oracion)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','966277D5F37663DE8F82FDED06DC4A63','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',101,NULL,0,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto,mayusculas)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto,oracion)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto,minusculas)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR,minusculas)} ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR,minusculas)} ${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not(funcion=mayusculas)]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto,minusculas)]} del ${frm:ante_propiedad[ant_prop_lugar(funcion=oracion)]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle(funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia(funcion=oracion)]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion(funcion=oracion)]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto,minusculas)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie(funcion=minusculas)]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos(funcion=capital)]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador (funcion=oracion)]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado (funcion=oracion)]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.</p>\n\n<p>B.- Sin gravamen de ninguna especie.</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.</p>\n\n<p>IV.- ${frm:operacion[op_isr(a)contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=COMPRADOR,oracion)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR,oracion)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR,minusculas)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not (funcion=mayusculas)]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad (funcion=oracion)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','966277D5F37663DE8F82FDED06DC4A63','2014-06-25 15:30:30'),('b6c957fb137b7e7f9d72712d7d0e439e','c4ca4238a0b923820dcc509a6f75849b','Escritura',102,NULL,1,'<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;${var:numero_libro(funcion=texto,mayusculas)}.-------------------${var:notaria_notario_iniciales}/${var:abogado_iniciales}/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a ${var:fecha_hoy(funcion=texto,oracion)}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>${var:notaria_notario}, titular de la notar&iacute;a n&uacute;mero ${var:notaria_numero(funcion=texto,minusculas)} del Distrito Federal, ${var:notaria_esasociada} despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte ${var:compareciente_tratamiento(tipo=COMPRADOR,minusculas)} ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra ${var:compareciente_tratamiento(tipo=VENDEDOR,minusculas)} ${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero ${frm:ante_propiedad[ant_prop_num_escritura(funcion=texto)]}, de fecha ${frm:ante_propiedad[ant_prop_fecha_esc(funcion=texto)]}, ante el licenciado ${frm:ante_propiedad[ant_prop_nom_not(funcion=mayusculas)]}, titular de la notar&iacute;a n&uacute;mero ${frm:ante_propiedad[ant_prop_num_not(funcion=texto,minusculas)]} del ${frm:ante_propiedad[ant_prop_lugar(funcion=oracion)]}, cuyo primer testimonio qued&oacute; inscrito en el ${frm:ante_propiedad[ant_prop_datos_ins]}, en el folio real n&uacute;mero ${frm:ante_propiedad[ant_prop_folio_real(funcion=texto)]}, ${var:compareciente_compro_estadocivil(tipo=VENDEDOR)}, &nbsp;${frm:ante_propiedad[ant_prop_titulo]}${var:compareciente_compro_proindiviso(tipo=VENDEDOR)}, en precio de ${frm:ante_propiedad[ant_prop_cost_adq(funcion=moneda)]}, moneda nacional, el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle(funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia(funcion=oracion)]}, delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion(funcion=oracion)]}, c&oacute;digo postal &nbsp;${frm:desc_inmueble[inm_codigo_postal(funcion=texto,minusculas)]}, en este ${frm:desc_inmueble[inm_estado]}, con una superficie de ${frm:desc_inmueble[inm_superficie(funcion=minusculas)]} y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;${frm:desc_inmueble[inm_linderos(funcion=capital)]}&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;${frm:ant_sit_catastral[ant_num_cta_predial]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_predial(funcion=letras)]}).</p>\n\n<p>B.-Agua:&ldquo;${frm:ant_sit_catastral[ant_num_cta_agua]}&rdquo;(${frm:ant_sit_catastral[ant_num_cta_agua(funcion=letras)]}).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de ${frm:ant_sit_catastral[ant_valor_catastral(funcion=moneda)]}, moneda nacional.</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de ${frm:ant_avaluo[ant_avaluo_valor(funcion=moneda)]}, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador (funcion=oracion)]}, el d&iacute;a ${frm:ant_avaluo[ant_avaluo_fecha(funcion=texto)]}, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- ${var:compareciente_ambos_compraron} al &nbsp;se&ntilde;or ${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ${frm:desc_inmueble[inm_num_ext(funcion=texto)]}, de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, &nbsp;con c&oacute;digo postal ${frm:desc_inmueble[inm_codigo_postal(funcion=texto)]}, del ${frm:desc_inmueble[inm_estado (funcion=oracion)]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de ${frm:operacion[op_precio(funcion=moneda)]}, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.</p>\n\n<p>B.- Sin gravamen de ninguna especie.</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.</p>\n\n<p>IV.- ${frm:operacion[op_isr(a)contenido=exento::Que respecto al Impuesto sobre la Renta, el ingreso percibido por &ldquo;LA PARTE VENDEDORA&rdquo; se encuentra exento, toda vez que declara:</p>\n\n<p>a) Que actualmente destina el inmueble objetivo de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asi mismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo. -------------</p>\n\n<p>|pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|perdida::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura de la letra &ldquo;#LETRA&rdquo;.|pm::Que respecto al Impuesto Sobre la Renta, este no se retiene por el suscrito notario en virtud de que &ldquo;LA PARTE VENDEDORA&rdquo; es una persona moral a las que se refiere al Titulo Segundo de la Ley del Impuesto Sobre la Renta.|exc_pago::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9; moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.<br />\nAsimismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, tener que hacer un pago provisional por la cantidad de &amp;referencia8; pesos, moneda nacional, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|exc_per::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el ingreso percibido por la cantidad de &amp;referencia9;, moneda nacional, se encuentra exento toda vez:</p>\n\n<p>a) Que actualmente destina el inmueble objeto de esta escritura para su casa habitaci&oacute;n, lo que a su vez justifica con el documento que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;. -----------------------</p>\n\n<p>b) Que el ingreso que percibe con motivo de la enajenaci&oacute;n consignada en este instrumento no excede del equivalente a setecientas mil unidades de inversi&oacute;n.</p>\n\n<p>c) Que la presente, es la primera enajenaci&oacute;n de casa habitaci&oacute;n que efect&uacute;a en los &uacute;ltimos cinco a&ntilde;os.</p>\n\n<p>Asimismo, declara que la superficie del terreno enajenado no excede tres veces al &aacute;rea de desplante de las construcciones del mismo.</p>\n\n<p>Asi mismo, por lo que se refiere al ingreso percibido por la cantidad de &amp;referencia10;, moneda nacional, declara &ldquo;LA PARTE VENDEDORA&rdquo;, no tener que pago alguno, de acuerdo con la liquidaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|pfcae::Que respecto al Impuesto Sobre la Renta, declara &ldquo;LA PARTE VENDEDORA&rdquo;, que este no se retiene en virtud de dedicarse a actividades empresariales de conformidad con los documentos que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;, asimismo declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura forma parte de su activo.)]}</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=se encuentra sujeto a contrato de arrendimiento ------------------.| no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.)]}</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:</p>\n\n<p>${var:compareciente_nombre(tipo=COMPRADOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=COMPRADOR,oracion)}, Estado de ${var:compareciente_nacimiento_estado(tipo=COMPRADOR,oracion)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=COMPRADOR)}, con domicilio en ${var:compareciente_domicilio(tipo=COMPRADOR,minusculas)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=COMPRADOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=COMPRADOR)}&rdquo;</p>\n\n<p>${var:compareciente_nombre(tipo=VENDEDOR,mayusculas)}, originario de ${var:compareciente_originario(tipo=VENDEDOR)}, Estado de ${var:compareciente_nacimiento_estado(tipo=VENDEDOR)}, lugar donde naci&oacute; el d&iacute;a ${var:compareciente_fecha_nacimiento(tipo=VENDEDOR)}, con domicilio en ${var:compareciente_domicilio(tipo=VENDEDOR)}, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;${var:compareciente_rfc(tipo=VENDEDOR)}&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;${var:compareciente_curp(tipo=VENDEDOR)}&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>REFERENCIAS{</p>\n\n<p>**referencia1;=${frm:gravamen[grav_cancelacion_fecha(funcion=texto)]}</p>\n\n<p>**referencia2;=${frm:gravamen[grav_cancelacion_num_esc(funcion=texto)]}</p>\n\n<p>**referencia3;=${frm:gravamen[escritura_fecha_elaboracion(funcion=texto)]}</p>\n\n<p>**referencia4;=${frm:gravamen[grav_cancelacion_nom_not (funcion=mayusculas)]}</p>\n\n<p>**referencia5;=${frm:gravamen[grav_cancelacion_num_not(funcion=texto)]}</p>\n\n<p>**referencia6;=${frm:gravamen[grav_canc_num_exp]}</p>\n\n<p>**referencia8;=${frm:operacion[op_isr_pago(funcion=moneda)]}</p>\n\n<p>**referencia9;=${frm:operacion[op_precio(funcion=moneda)]}</p>\n\n<p>**referencia10;=${frm:operacion[op_isr_noexenta(funcion=moneda)]}</p>\n\n<p>**referencia11;=${frm:gravamen[grav_cancelacion_entidad (funcion=oracion)]}</p>\n\n<p>}</p>\n\n<p>&nbsp;</p>\n','966277D5F37663DE8F82FDED06DC4A63','2014-06-25 15:30:30');
