Nueva Santa María, Azcapotzalco, México D.F, C.P 12000_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_JORGE1234 y JORGE1234_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_JORGE1234 y JORGE1234_&rdquo;</p>\n\n<p>_Luis López Pérez  y Luis López Pérez _, originario de _Tlalnepantla y Tlalnepantla_, Estado de _Estado de México y Estado de México_, lugar donde naci&oacute; el d&iacute;a _DIECISIETE DE JUNIO DE DOS MIL CATORCE DIECISEIS DE JUNIO DE DOS MIL CATORCE _, con domicilio en Mariano Yañez #92, Fracc. Benito Juárez, Iztacalco, México D.F, C.P 08930 y Mariano Yañez #92, Fracc. Benito Juárez, Iztacalco, México D.F, C.P 08930_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_EIVV841223QR1 y EIVV841223QR1_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_EIVV841223QR1DF y EIVV841223QR1DF_&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n'),('9576083c781be9eff6975a721bb2e8b8','a78af1c4dbaf66c637b6e76792cc312c','2014-09-17',0,1,'','2014-09-18 00:29:45','<b>VERSION DEL MODELO: 102</b><br /><p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;MIL CIEN .-------------------LDG/PEP/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a Diecisiete  de septiembre de dos mil catorce .&nbsp;&nbsp; &nbsp;</p>\n\n<p>LUIS RICARDO DUARTE GUERRA, titular de la notar&iacute;a n&uacute;mero veinticuatro  del Distrito Federal, actuando como asociado en el protocolo de la notaría número noventa y ocho, de la que es titular el licenciado GONZALO M. ORTÍZ BLANCO, despu&eacute;s de haberme identificado plenamente como notario, hago constar la compraventa que celebran de una parte el señor GONZALO MANUEL ORTÍZ BLANCO, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra el señor LUIS RICARDO DUARTE GUERRA, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S &nbsp;</strong></p>\n\n<p>I.- Por escritura n&uacute;mero sesenta y dos mil sesenta y dos , de fecha siete  de noviembre de dos mil ocho , ante el licenciado OMAR M. NOVELO RIVAS, titular de la notar&iacute;a n&uacute;mero veintisiete  del Distrito Federal, cuyo primer testimonio qued&oacute; inscrito en el Registro Público de la Propiedad de esta capital, en el folio real n&uacute;mero nueve millones doscientos cuarenta y seis mil ciento ochenta y dos , Los señores LUIS RICARDO DUARTE GUERRA y Fulanita De tal  estando casados entre sí bajo el regimen de separación de bienes (según consta de la copia certificada del acta de matrimonio que se me exhibe y que en copia fotostática agrego al apéndice de esta escritura con la letra #LETRA), adquirieron por, &nbsp;Compraventay pro-indiviso por partes iguales, en precio de cincuenta y tres millones quinientos seis mil setenta pesos con treinta y cinco  centavos, moneda nacional, el inmueble marcado con el n&uacute;mero ochenta y tres , de la calle Altavista, colonia San Ángel, delegaci&oacute;n Álvaro Obregón, c&oacute;digo postal &nbsp;mil cuarenta , en este Distrito Federal, con una superficie de quinientos metros cuadrados y los linderos que en t&iacute;tulo se relaciona se describieron como sigue: &ldquo;AlNorteEnVeinticincoMetrosConCalleJoseDeTeresa,AlSurEnVeinticincoMetrosConLoteTres,AlEsteConCasaQueFueDeLaSeñoraNormaVallejo,AlOesteEnVeinticincoMetrosConCalleDeAltavista&rdquo;.</p>\n\n<p>II.-${frm:gravamen[grav_cancelado_tipo(contenido=grav_lib::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de libertad de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.|grav_mis:: Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura no reporta m&aacute;s gravamen que la hipoteca relacionada en el antecedente anterior, y que por lo dem&aacute;s se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1;, que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.<br />\nEs de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada m&aacute;s adelante en este mismo instrumento.|grav_pre::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero &amp;referencia2;, de fecha &amp;referencia3;, ante el licenciado &amp;referencia4;, &nbsp;titular de la notar&iacute;a n&uacute;mero &amp;referencia5;, &amp;referencia11;, cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.|grav_pos::Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a &nbsp;&amp;referencia1; que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p>Es de advertir que la hipoteca que reporta dicho certificado ser&aacute; cancelada en instrumento por separado.)]}</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:</p>\n\n<p>A.-Predial:&ldquo;033-021-02-266-6&rdquo;(cero tres tres guion cero dos uno guion cero dos guion dos seis seis guion seis ).</p>\n\n<p>B.-Agua:&ldquo;16-45-252-541-03-266-6&rdquo;(uno seis guion cuatro cinco guion dos cinco dos guion cinco cuatro uno guion cero tres guion dos seis seis guion seis ).</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;.</strong></p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de dos millones cien mil pesos, moneda nacional.</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de dos millones de pesos, moneda nacional, seg&uacute;n el aval&uacute;o formulado por ${frm:ant_avaluo[ant_avaluo_valuador (funcion=oracion)]}, el d&iacute;a primero  de abril de dos mil catorce , que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.</p>\n\n<p>&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S. </strong></p>\n\n<p>PRIMERA.- Los señores LUIS RICARDO DUARTE GUERRA y Fulanita De tal  venden al &nbsp;se&ntilde;or GONZALO MANUEL ORTÍZ BLANCO, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero ochenta y tres , de la calle ${frm:desc_inmueble[inm_calle (funcion=oracion)]}, colonia ${frm:desc_inmueble[inm_colonia (funcion=oracion)]}, &nbsp;delegaci&oacute;n ${frm:desc_inmueble[inm_delegacion (funcion=oracion)]}, &nbsp;con c&oacute;digo postal mil cuarenta , del ${frm:desc_inmueble[inm_estado (funcion=oracion)]}, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente</p>\n\n<p>I.- El precio importa la suma de cinco millones de pesos, moneda nacional.</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.</p>\n\n<p>B.- Sin gravamen de ninguna especie.</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.</p>\n\n<p>IV.- exc_pago</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno.</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:</p>\n\n<p>GONZALO MANUEL ORTÍZ BLANCO, originario de Jalapa, Estado de Veracruz, lugar donde naci&oacute; el d&iacute;a diecisiete  de junio de dos mil catorce, con domicilio en altavista ochenta y tres, col. san angel, del. alvaro obregón, código postal cero mil cuarenta y nueve, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;GORTIZ2312&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;GORTIZ2312&rdquo;</p>\n\n<p>LUIS RICARDO DUARTE GUERRA, originario de Tlalnepantla, Estado de México, lugar donde naci&oacute; el d&iacute;a diecisiete  de junio de dos mil catorce, con domicilio en Culiacan ciento veintitres, Hipódromo, código postal cero seismil ciento setenta Ciudad de México, Distrito Federal, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;RDUARTE1234&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;RDUARTE1234&rdquo;.</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>'),('d84ec89e531c72d54eec6772cc78e3dd','234b8895cc0f7daedae06edecf1730b8','2014-08-19',2,1,'686FD10F44E888F6064671CEA5A1E7D5','2014-08-19 14:49:47','<p><strong>VERSION DEL MODELO: 54</strong></p>\n\n<p>COMPRAVENTA CASAHABITACION DF</p>\n\n<p>&nbsp;</p>\n\n<p>Libro &nbsp;mil cien .-------------------GOB/PEP/${var:protocolista_iniciales}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>- - - M&Eacute;XICO, DISTRITO FEDERAL, a diecinueve de agosto de dos mil catorce .&nbsp;&nbsp; &nbsp;</p>\n\n<p>Gonzalo Ort&iacute;z Blanco, titular de la notar&iacute;a n&uacute;mero noventa y ocho del Distrito Federal, despu&eacute;s de haberme identificado plenamente como notario, hago constar la Compraventa que celebran de una parte V&iacute;ctor Daniel Espinosa V&aacute;zquez , en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra Omar Flores Cruz , en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero quinientos , de fecha primero de julio de dos mil catorce , ante el licenciado Mario P&eacute;rez, titular de la notar&iacute;a n&uacute;mero veinte del Distrito Federal, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad del Distrito Federal, bajo el n&uacute;mero sesenta y cinco, en el folio real n&uacute;mero doscientos cincuenta , El se&ntilde;or Omar Flores Cruz estando casado con La se&ntilde;ora Fulanita De tal bajo el regimen de sociedad conyugal (seg&uacute;n consta de la copia certificada del acta de matrimonio que se me exhibe y que en copia fotost&aacute;tica agrego al ap&eacute;ndice de esta escritura con la letra #LETRA) adquiri&oacute; por, &nbsp;Compraventa , en precio de un millon de pesos, moneda nacional, el inmueble marcado con el n&uacute;mero Doce, de la calle Mariano Ya&ntilde;ez, colonia Fracc. Benito Ju&aacute;rez delegaci&oacute;n Iztacalco del Distrito Federal, con la superficie DOCIENTOS METROS CUADRADOS y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p><em>&ldquo;</em>Al norte con Eje Central y al Sur con calzada de Tlalpan<em>&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.-Declara &quot;LA PARTE VENDEDORA&quot;, bajo protesta de decir la verdad, que el inmueble objeto de esta escritura se encuentra libre de grav&aacute;menes, lo que justifica con el certificado de grav&aacute;menes presentado en el Registro P&uacute;blico de la Propiedad de esta capital, el d&iacute;a primero de julio de dos mil catorce que agrego al ap&eacute;ndice de esta escritura con la letra &ldquo;#LETRA&rdquo;.</p>\n\n<p><br />\n&nbsp;</p>\n\n<p>Es de advertir que la hipoteca que aparece en dicho certificado, no tiene raz&oacute;n de ser en virtud de haber sido cancelada mediante escritura n&uacute;mero ciento veintitres con fecha primero de julio de dos mil catorce , ante el notario Mario P&eacute;rez titular de la notar&iacute;a n&uacute;mero veintiunO , cuyo primer testimonio se encuentra pendiente de ser inscrito en el Registro P&uacute;blico de la Propiedad de esta capital.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;5529615918&rdquo;(CINCO CINCO DOS NUEVE SEIS UNO CINCO NUEVE UNO OCHO ).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;23121984&rdquo;(DOS TRES UNO DOS UNO NUEVE OCHO CUATRO _).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de un millon &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de un millon doscientos mil de pesos &nbsp;Moneda Nacional, seg&uacute;n el aval&uacute;o formulado por Valuadores SA de C.V, el d&iacute;a primero de julio de dos mil catorce , que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- El se&ntilde;or Omar Flores Cruz vende con el consentimiento de su conyuge La se&ntilde;ora Fulanita De tal al &nbsp;se&ntilde;or V&iacute;ctor Daniel Espinosa V&aacute;zquez , quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero Doce, de la calle Mariano Ya&ntilde;ez, colonia Fracc. Benito Ju&aacute;rez delegaci&oacute;n Iztacalco del Distrito Federal, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.</p>\n\n<p>&nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de un millon , moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta: esta excento</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, ${frm:desc_inmueble[inm_arrendamiento(contenido=s&iacute; hay arrendimiento*****|no se encuentra sujeto a &nbsp;contrato de arrendamiento alguno)]}.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>V&iacute;ctor Daniel Espinosa V&aacute;zquez , originario de N/A, Estado de M&eacute;xico Distrito Federal, lugar donde naci&oacute; el d&iacute;a diecisiete de junio de dos mil catorce , con domicilio en Mariano Ya&ntilde;ez #92, Fracc. Benito Ju&aacute;rez, Iztacalco, M&eacute;xico D.F, 08930, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;EIVV841223QR1&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;EIVV841223QR1DF&rdquo;</p>\n\n<p>Omar Flores Cruz , originario de Mendoza, Estado de Veracruz, lugar donde naci&oacute; el d&iacute;a siete de junio de dos mil catorce , con domicilio en Cocoleros # 6, Col. Nueva Santa Mar&iacute;a, Distrito Federal, Iztacalco, C.P. 08930, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;OMAR2312QR1&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;OMAR2312DF984&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa.</p>\n\n<p>&nbsp;</p>\n\n<p>VIII.- Que advert&iacute; a los comparecientes de las penas en que incurren quienes declaran falsamente ante notario.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IX.- Que tuve a la vista los documentos citados en esta escritura.&nbsp;&nbsp; &nbsp;</p>\n\n<p>X.- Que a solicitud de los comparecientes, a quienes atend&iacute; personalmente, le&iacute; y expliqu&eacute; esta escritura a los mismos, una vez que les hice saber el derecho que tienen de leerla personalmente, manifestando los otorgantes su conformidad y comprensi&oacute;n plena y la firmaron el d&iacute;a</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n');
