s titular el licenciado Luis Ricardo Duarte Guerra, despu&eacute;s de haberme identificado plenamente como notario, hago constar la Compraventa que celebran de una parte_Federico Vargas Ortíz _, en lo sucesivo &ldquo;LA PARTE COMPRADORA&rdquo; y de otra_Carlos Farias Ayala Fulanito de tal_, en lo sucesivo &ldquo;LA PARTE VENDEDORA&rdquo;, al tenor de los siguientes antecedentes y cl&aacute;usulas:&nbsp;&nbsp; &nbsp;</p>\n\n<p>--------------------- <strong>A N T E C E D E N T E S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Por escritura n&uacute;mero_TRESCIENTOS _, de fecha_DIECISEIS DE JULIO DE DOS MIL CATORCE _, ante el licenciado_Juan López_, titular de la notar&iacute;a n&uacute;mero _VEINTIUNO _ del _México D.F_, cuyo primer testimonio qued&oacute; inscrito en el Registro P&uacute;blico de la Propiedad de _ESTE DOCIENTOS_, en el folio real n&uacute;mero _CIEN _, _El señor Carlos Farias Ayala estando casado con La señora Fulanita De tal  bajo el regimen de sociedad conyugal (según consta de la copia certificada del acta de matrimonio que se me exhibe  y que en copia fotostática agrego al apéndice de esta escritura con la letra #LETRA) adquirió por_, por_Compraventa_, en precio de _DOS MILLONES _pesos, moneda nacional,el inmueble marcado con el n&uacute;mero 92, de la calle Mariano Yañez, colonia Fracc. Benito Juárez  delegaci&oacute;n Iztacalco del México, con la superficie Doscientos m2 y los linderos que en t&iacute;tulo se relaciona se describieron como sigue:</p>\n\n<p>&nbsp;</p>\n\n<p><em>&ldquo;&hellip;_</em> Cerca del metro camarones<em>_&hellip;&rdquo;.</em></p>\n\n<p>&nbsp;</p>\n\n<p>II.- Declara &ldquo;LA PARTE VENDEDORA&rdquo;, bajo protesta de decir verdad, que el inmueble objeto de esta escritura NO LIBRE DE GRAVAMEN_, que &nbsp;agrego al &nbsp;ap&eacute;ndice &nbsp;de este &nbsp;instrumento &nbsp;con &nbsp;la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Declaran &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; que el inmueble objeto de esta escritura paga sus contribuciones con los siguientes n&uacute;meros de cuenta:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.-Predial:&ldquo;_2312123_&rdquo;(_DOS TRES UNO DOS UNO DOS TRES _).&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.-Agua:&ldquo;_29615918_&rdquo;(_DOS NUEVE SEIS UNO CINCO NUEVE UNO OCHO _).&nbsp;&nbsp; &nbsp;</p>\n\n<p>Asimismo, declara &ldquo;LA PARTE VENDEDORA&rdquo; que el inmueble objeto de esta escritura no tiene adeudos por dichas contribuciones lo que justifica con las constancias de adeudo del impuesto predial y de derechos por suministro de agua que agrego al ap&eacute;ndice de esta escritura con las letras <strong>&ldquo;#LETRA&rdquo;</strong> y <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- El valor catastral del inmueble objeto de esta escritura es &nbsp;la cantidad de _UN MILLON QUINIENTOS MIL _ &nbsp;moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>V.- El valor comercial del inmueble objeto de esta escritura es la cantidad de _UN MILLON QUINIENTOS MIL _PESOS, MONEDA NACIONAL, seg&uacute;n el aval&uacute;o formulado por _Omar Flores Hernández_, el d&iacute;a _VEINTICUATRO  DE JULIO DE DOS MIL CATORCE _, que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Con la letra <strong>&ldquo;#LETRA&rdquo;</strong> agreg&oacute; al ap&eacute;ndice de esta escritura la Solicitud del Certificado &Uacute;nico de Zonificaci&oacute;n de Uso de Suelo.&nbsp;&nbsp; &nbsp;</p>\n\n<p>---------------------- <strong>C L &Aacute; U S U L A S.</strong>&nbsp;&nbsp; &nbsp;</p>\n\n<p>PRIMERA.- _El señor Carlos Farias Ayala vende con el consentimiento de su conyuge La señora Fulanita De tal _, al &nbsp;se&ntilde;or_Federico Vargas Ortíz _, quien adquiere &nbsp;el inmueble marcado con el n&uacute;mero 92, de la calle Mariano Yañez, colonia Fracc. Benito Juárez  delegaci&oacute;n Iztacalco del México_, con las superficie y linderos descritos en el antecedente primero de esta escritura, que se tienen aqu&iacute; por reproducidos como si a la letra se insertasen con las caracter&iacute;sticas, antig&uuml;edad, estado de conservaci&oacute;n y superficie de las construcciones especificadas en el aval&uacute;o de dicho inmueble.&nbsp;&nbsp; &nbsp;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>SEGUNDA. - La compraventa se rige por lo siguiente:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- El precio importa la suma de _DOS MILLONES _, moneda nacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>II.- La propiedad vendida pasa a poder de &ldquo;LA PARTE COMPRADORA&rdquo;:&nbsp;&nbsp; &nbsp;</p>\n\n<p>A.- Sin limitaci&oacute;n alguna en su dominio.&nbsp;&nbsp; &nbsp;</p>\n\n<p>B.- Sin gravamen de ninguna especie.&nbsp;&nbsp; &nbsp;</p>\n\n<p>C.- Sin ning&uacute;n adeudo, incluso de car&aacute;cter fiscal o laboral. Cualquier adeudo de la &iacute;ndole que fuere a la fecha de firma de esta escritura, ser&aacute; por cuenta exclusiva de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>TERCERA.- &ldquo;LA PARTE COMPRADORA&rdquo; se obliga a destinar el inmueble &nbsp;objeto de esta escritura, a un uso que no contravenga las disposiciones legales vigentes.&nbsp;&nbsp; &nbsp;</p>\n\n<p>CUARTA.- Todos los gastos, impuestos, derechos y honorarios que se causen con motivo de esta escritura, ser&aacute;n cubiertos por &ldquo;LA PARTE COMPRADORA&rdquo;, excepto el Impuesto Sobre la Renta, el cual ser&aacute; a cargo de &ldquo;LA PARTE VENDEDORA&rdquo;.&nbsp;&nbsp; &nbsp;</p>\n\n<p>QUINTA.- Para la interpretaci&oacute;n y cumplimiento de esta escritura, las partes se someten a las leyes y tribunales del Distrito Federal.&nbsp;&nbsp; &nbsp;</p>\n\n<p>YO EL NOTARIO CERTIFICO:&nbsp;&nbsp; &nbsp;</p>\n\n<p>I.- Que a mi juicio los comparecientes tienen capacidad legal para la celebraci&oacute;n de este acto, y que me asegur&eacute; de su identidad conforme a la relaci&oacute;n que agrego al ap&eacute;ndice de esta escritura con la letra <strong>&ldquo;#LETRA&rdquo;</strong>.-------------------------------------------------</p>\n\n<p>II.- Que advert&iacute; a &ldquo;LA PARTE COMPRADORA&rdquo; que ser&aacute; responsable solidaria en el pago de las contribuciones que pudiesen aparecer &nbsp;relacionadas con el inmueble objeto de esta escritura, &nbsp;anteriores &nbsp;a &nbsp;la fecha de firma de este instrumento.&nbsp;&nbsp; &nbsp;</p>\n\n<p>III.- Que respecto al Impuesto al Valor Agregado, declara &quot;LA PARTE VENDEDORA&quot;, que este no se causa en virtud de que el inmueble objeto de esta escritura ha sido destinado a unidad habitacional.&nbsp;&nbsp; &nbsp;</p>\n\n<p>IV.- Que respecto al Impuesto Sobre la Renta:_esta excento_</p>\n\n<p>V.- Que &ldquo;LA PARTE VENDEDORA&rdquo; y &ldquo;LA PARTE COMPRADORA&rdquo; declaran que el inmueble objeto de esta escritura, si hay arrendimiento*****.&nbsp;&nbsp; &nbsp;</p>\n\n<p>VI.- Que los comparecientes declaran por sus generales ser:&nbsp;&nbsp; &nbsp;</p>\n\n<p>_Federico Vargas Ortíz _, originario de _Perote_, Estado de _Veracruz_, lugar donde naci&oacute; el d&iacute;a _DIECISIETE DE JUNIO DE DOS MIL CATORCE _, con domicilio en Alabama 84, Napoles, México D.F_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_VOF630623_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_VOF630623DFH_&rdquo;</p>\n\n<p>_Carlos Farias Ayala Fulanito de tal_, originario de _Cordoba_, Estado de _Veracruz_, lugar donde naci&oacute; el d&iacute;a _DIECISIETE DE JUNIO DE DOS MIL CATORCE _, con domicilio en Mariano Yañez # 92, Col. Fraccionamiento Benito Juárez, México, Df, Iztacalco, C.P. 08930_, con Registro Federal de Contribuyentes n&uacute;mero: &ldquo;_CARLOS1234_&rdquo;, y Clave &Uacute;nica de Registro de Poblaci&oacute;n n&uacute;mero: &nbsp;&ldquo;_CARLOS1234_&rdquo;.</p>\n\n<p>&nbsp;</p>\n\n<p>VII.- Que &ldquo;LA PARTE VENDEDORA&rdquo; recibi&oacute; de &ldquo;LA PARTE COMPRADORA&rdquo; el importe de la compraventa</p>\n\n<p>&nbsp;</p>